$(document).ready(function(){$(".accordion-toggle").on("click",function(){const e=$(this),t=e.data("parent"),n=e.data("show");e.parent(t).toggleClass("active"),e.parent(t).children(n).slideToggle(300)});var e=new Swiper(".mySwiper",{});$(".swiper-button-next").on("click",()=>e.slideNext()),$(".swiper-button-prev").on("click",()=>e.slidePrev())});